import React from "react";
import AllList from "./AllList";
import { Button, Card, CardBody, CardSubtitle, CardText, Container } from "reactstrap";

const OneList = ({ product }) => {
    return (
        <Card style={{height: '200px', borderBlockEndColor: 'black', width: '300px'}}>
            <CardBody>
                <CardSubtitle className="font-weight-bold">{product.productName}</CardSubtitle>
                <CardText>{product.prize}</CardText>
                <Container className="">
                    <Button color="danger">Delete</Button>
                    <Button color="warning">Update</Button>
                </Container>
            </CardBody>
        </Card>
    );
};

export default OneList
